import React from 'react';
import products from '../products.js';
import Product from '../components/Product';

const HomeScreen = () => {
  return (
    <div>
      <h1>Latest Products</h1>
      {products.map((item) => (
        <Product item={item} />
      ))}
    </div>
  );
};

export default HomeScreen;
